INSERT INTO `notice` (`id`, `notice`, `time`) VALUES
(1, 'নতুন একাউন্ট খুলে রিচার্জ না করলে একাউন্ট ডিলিট করা হবে! সকল কাজের আপডেট জানতে আমাদের হোয়াটসঅ্যাপ গ্রুপে জয়েন করুন।', '2022-12-05 08:59:43'),
(2, 'সাইন কপি থেকে আন অফিসিয়াল সার্ভার কপি ডাউনলোড করতে পারবেন। আমাদের সকল কাজের আপডেট জানতে সাপোর্টে ক্লিক করে আমাদের WhatsApp গ্রুপে সংযুক্ত থাকুন, আমাদের সাথে থাকার জন্য ধন্যবাদ**', '2022-12-08 17:36:16'),
(3, 'আন অফিসিয়াল সার্ভার কপি 10 টাকা করে কাটবে। নতুন একাউন্ট খুলে রিচার্জ না করলে একাউন্ট ডিলিট করা হবে! সকল কাজের আপডেট পেতে এবং কাজ করতে যেকোনো সমস্যায় আমাদের হোয়াটসঅ্যাপ গ্রুপে জয়েন্ট থাকার জন্য অনুরোধ করছি, আমাদের সাথে থাকার জন্য ধন্যবাদ**', '2022-12-08 17:36:16'),
(4, 'অটো মেইক এর বর্তমানে এপিআই বিছিন্ন থাকার, কারণে,অটো মেইক বন্ধ রয়েছে। আপাতত ম্যনুয়েল মেইক করুন। সাময়িক অসুবিধার জন্য আন্তরিক ভাবে দুঃখিত। আমাদের সকল কাজের আপডেট জানতে সাপোর্টে ক্লিক করে আমাদের WhatsApp গ্রুপে সংযুক্ত থাকুন, আমাদের সাথে থাকার জন্য ধন্যবাদ**', '2022-12-08 17:38:21'),
(5, 'একাউন্ট খুলে রিচার্জ না করলে একাউন্ট ডিলিট করা হবে! সকল কাজের আপডেট জানতে আমাদের হোয়াটসঅ্যাপ গ্রুপে জয়েন করুন।', '2022-12-08 17:38:21'),
(6, 'শুধু টিন নাম্বার দিয়ে টিন সার্টিফিকেট চলমান, অফিসিয়াল টিন সার্টিফিকেট চালমান সবাই কাজ করুন।**', '2022-12-08 17:38:21'),
(7, 'Vip সুরক্ষার ক্লোন চালমান সবাই কাজ করুন। একাউন্ট খুলে রিচার্জ না করলে একাউন্ট ডিলিট করা হবে! সকল কাজের আপডেট জানতে আমাদের হোয়াটসঅ্যাপ গ্রুপে জয়েন করুন।, আমাদের সাথে থাকার জন্য ধন্যবাদ***', '2022-12-08 17:38:21'),
(8, 'অফিসিয়াল সার্ভার কপি চালু। আমাদের সকল কাজের আপডেট জানতে সাপোর্টে ক্লিক করে আমাদের WhatsApp গ্রুপে সংযুক্ত থাকুন। আমাদের সাথে থাকার জন্য ধন্যবাদ***', '2022-12-08 17:38:21'),
(9, 'আমাদের সকল কাজের আপডেট জানতে সাপোর্টে ক্লিক করে আমাদের WhatsApp গ্রুপে সংযুক্ত থাকুন, আমাদের সাথে থাকার জন্য ধন্যবাদ***', '2022-12-08 17:38:21'),
(10, 'আমাদের সকল কাজের আপডেট জানতে সাপোর্টে ক্লিক করে আমাদের WhatsApp গ্রুপে সংযুক্ত থাকুন, আমাদের সাথে থাকার জন্য ধন্যবাদ***', '2022-12-08 17:38:21'),
(11, 'নাম ঠিকানা, সঠিক ভাবে দিয়ে পূরণ করে,সাবমিট দিতে হবে! একাউন্ট খুলে রিচার্জ না করলে একাউন্ট ডিলিট করা হবে!! সকল কাজের আপডেট জানতে আমাদের হোয়াটসঅ্যাপ গ্রুপে জয়েন করুন। ', '2022-12-08 17:38:21');
